import React from "react";
import ReactDOM from "react-dom";
import Card from "./card";
import contacts from "../contacts";

function card(contacts) {
   <Card id={contacts.id} name={contacts.name} imgurl={contacts.imgURL} phone={contacts.phone} email = {contacts.email} /> 
}

function App(params) {
  return <div>
   {contacts.map(card)}
   </div>
}

export default App;
